import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  template: `
  <body>
    <app-header></app-header>

    <router-outlet></router-outlet>

    <app-footer></app-footer> 
  </body>
  `,
  styles: [`
  /* UTILITIES */
  * {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
  }
  
  body {
    font-family: cursive;
  }
  
  a {
    text-decoration: none;
  }
  
  li {
    list-style: none;
  }
  `,]
})
export class AppComponent {
  title = 'frontend';
}
